import React, { useState, useEffect } from 'react';
import { FaCalendarCheck, FaEye, FaCheck, FaTimes } from 'react-icons/fa';
import Layout from '../components/layout/Layout';
import PageHeader from '../components/common/PageHeader';
import { bookingApi } from '../services/api';

const Bookings = () => {
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchBookings();
  }, []);

  const fetchBookings = async () => {
    try {
      const response = await bookingApi.getAll();
      setBookings(response.data?.data || []);
    } catch (error) {
      setError('Failed to fetch bookings');
      console.error('Error fetching bookings:', error);
    } finally {
      setLoading(false);
    }
  };

  const getStatusBadgeClass = (status) => {
    switch (status) {
      case 'completed':
        return 'badge-success';
      case 'confirmed':
        return 'badge-info';
      case 'cancelled':
        return 'badge-error';
      default:
        return 'badge-warning';
    }
  };

  if (loading) {
    return (
      <Layout>
        <div className="flex items-center justify-center min-h-screen">
          <div className="loading-spinner" />
        </div>
      </Layout>
    );
  }

  if (error) {
    return (
      <Layout>
        <div className="p-4">
          <div className="bg-red-50 text-red-700 p-4 rounded-lg">
            {error}
          </div>
        </div>
      </Layout>
    );
  }

  return (
    <Layout>
      <div className="min-h-screen bg-gray-50 p-6">
        <div className="max-w-7xl mx-auto">
          <PageHeader
            title="Bookings"
            description="Manage your tour bookings"
          />

          <div className="bg-white rounded-lg shadow-sm overflow-hidden">
            <div className="min-w-full divide-y divide-gray-200">
              <div className="bg-gray-50">
                <div className="grid grid-cols-12 gap-4 px-6 py-3">
                  <div className="col-span-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Customer</div>
                  <div className="col-span-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Package</div>
                  <div className="col-span-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Amount</div>
                  <div className="col-span-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Status</div>
                  <div className="col-span-2 text-right text-xs font-medium text-gray-500 uppercase tracking-wider">Actions</div>
                </div>
              </div>

              <div className="bg-white divide-y divide-gray-200">
                {bookings.map((booking) => (
                  <div key={booking.id} className="hover:bg-gray-50">
                    <div className="grid grid-cols-12 gap-4 px-6 py-4 items-center">
                      <div className="col-span-3">
                        <div className="flex items-center">
                          <div className="flex-shrink-0 h-10 w-10">
                            <div className="h-10 w-10 rounded-full bg-gray-200 flex items-center justify-center">
                              <span className="text-sm font-medium text-gray-500">
                                {booking.customer_name?.charAt(0) || 'U'}
                              </span>
                            </div>
                          </div>
                          <div className="ml-4">
                            <div className="text-sm font-medium text-gray-900">{booking.customer_name}</div>
                            <div className="text-sm text-gray-500">{booking.customer_email}</div>
                          </div>
                        </div>
                      </div>
                      <div className="col-span-3">
                        <div className="text-sm text-gray-900">{booking.package_name}</div>
                        <div className="text-sm text-gray-500">{booking.duration}</div>
                      </div>
                      <div className="col-span-2">
                        <div className="text-sm font-medium text-gray-900">
                          ${booking.total_amount?.toLocaleString()}
                        </div>
                      </div>
                      <div className="col-span-2">
                        <span className={`badge ${getStatusBadgeClass(booking.status)}`}>
                          {booking.status}
                        </span>
                      </div>
                      <div className="col-span-2 text-right space-x-2">
                        <button className="btn btn-sm btn-secondary">
                          <FaEye className="h-4 w-4" />
                        </button>
                        <button className="btn btn-sm btn-primary">
                          <FaCheck className="h-4 w-4" />
                        </button>
                        <button className="btn btn-sm btn-danger">
                          <FaTimes className="h-4 w-4" />
                        </button>
                      </div>
                    </div>
                  </div>
                ))}

                {bookings.length === 0 && (
                  <div className="text-center py-12">
                    <FaCalendarCheck className="mx-auto h-12 w-12 text-gray-400" />
                    <h3 className="mt-2 text-sm font-medium text-gray-900">No bookings</h3>
                    <p className="mt-1 text-sm text-gray-500">No bookings have been made yet.</p>
                  </div>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
    </Layout>
  );
};

export default Bookings;
